namespace clouds.products;

using clouds.products from '../db/index';
using clouds.foundation as fnd from 'hana-xsa-apm-foundation/db';

service CatalogService {
	@Capabilities.SearchRestrictions.Searchable
	entity Products @(
		title: '{i18n>product}',
		Common: {
			SemanticKey: [ID],
			SideEffects#BaseUnit: {
				SourceProperties: [baseUnit_code],
				TargetEntities: [baseUnit],
				EffectTypes: #ValueChange
			},
			SideEffects#DimensionUnit: {
				SourceProperties: [dimensionUnit_code],
				TargetEntities: [dimensionUnit],
				EffectTypes: #ValueChange
			},
			SideEffects#WeightUnit: {
				SourceProperties: [weightUnit_code],
				TargetEntities: [weightUnit],
				EffectTypes: #ValueChange
			},
			SideEffects#Category: {
				SourceProperties: [category_ID],
				TargetEntities: [category],
				EffectTypes: #ValueChange
			},
			SideEffects#Supplier: {
				SourceProperties: [supplier_ID],
				TargetEntities: [supplier],
				EffectTypes: #ValueChange
			},
			SideEffects#AdminData: {
				SourceProperties: [baseUnit_code, dimensionUnit_code, weightUnit_code, category_ID, supplier_ID, name, description, price, currency, height, width, depth, weight],
				TargetProperties: [modifiedBy, modifiedAt],
				EffectTypes: #ValueChange
			}
		}
	) as projection on products.Products;
	@Capabilities.SearchRestrictions.Searchable
	entity Categories @(
		title: '{i18n>category}',
		Common: {
			SideEffects#AdminData: {
				SourceProperties: [name, description],
				TargetProperties: [modifiedBy, modifiedAt],
				EffectTypes: #ValueChange
			}
		}
	) as projection on products.Categories;
	entity Suppliers @(
		title: '{i18n>supplier}',
		Communication.Contact: {
			fn: name,
			tel: [
				{type: #fax, uri: faxNumber},
				{type: #work, uri: phoneNumber}
			],
			email: [
				{type: #work, address: emailAddress}
			]}
	) as projection on products.Suppliers excluding { address };
	entity Stocks @(title: '{i18n>stock}') as projection on products.Stocks;
	entity StockAvailabilities @(title: '{i18n>stockAvailability}') as projection on products.StockAvailabilities;
	entity PriceRanges @(title: '{i18n>priceRange}') as projection on products.PriceRanges;
	entity Currencies @(title: '{i18n>currency}') as projection on fnd.Currencies;
	entity DimensionUnits @(title: '{i18n>dimensionUnit}') as projection on fnd.Measures.Units.Lengths;
	entity WeightUnits @(title: '{i18n>weightUnit}') as projection on fnd.Measures.Units.Weights;
	entity BaseUnits @(title: '{i18n>baseUnit}') as projection on fnd.Measures.Units.Bases;
}

namespace clouds.products;

using clouds.foundation as fnd from 'hana-xsa-apm-foundation/db';
using clouds.foundation.CodeList;

entity Products: fnd.BusinessObject {
	// general info
	name: localized String not null @(
		title: '{i18n>name}',
		Common.FieldControl: #Mandatory,
		Search.defaultSearchElement
	);
	description: localized String not null @(
		title: '{i18n>description}',
		Common.FieldControl: #Mandatory
	);
	category: Association to Categories not null @(
		title: '{i18n>category}',
		Common: {
			Text: {$value: category.name, "@UI.TextArrangement": #TextOnly},
			ValueList: {entity: 'Categories', type: #fixed},
			FieldControl: #Mandatory
		}
	);
	image: fnd.ImageURL;

	// price 
	price: Decimal(10, 3) not null @(
		title: '{i18n>pricePerUnit}',
		Measures.ISOCurrency: currency,
		Common.FieldControl: #Mandatory
	);
	currency: fnd.Currency not null @(
		title: '{i18n>currency}',
		Common.ValueList: {entity: 'Currencies', type: #fixed},
		Common.FieldControl: #Mandatory
	);
	priceRange: Association to PriceRanges @(
		title: '{i18n>priceRange}',
		Common: {
			Text: {$value: priceRange.name, "@UI.TextArrangement": #TextOnly},
			ValueList: {entity: 'PriceRanges', type: #fixed},
			ValueListWithFixedValues
		},
		Common.FieldControl: #ReadOnly
	);

	// dimensions & weight
	height: fnd.Measures.Length @(
		title: '{i18n>height}',
		Measures.Unit: dimensionUnit_code
	);
	width: fnd.Measures.Length @(
		title: '{i18n>width}',
		Measures.Unit: dimensionUnit_code
	);
	depth: fnd.Measures.Length @(
		title: '{i18n>depth}',
		Measures.Unit: dimensionUnit_code
	);
	weight: fnd.Measures.Weight @Measures.Unit: weightUnit_code;

	dimensionUnit: Association to fnd.Measures.Units.Lengths @(
		title: '{i18n>dimensionUnit}',
		Common: {
			Text: {$value: dimensionUnit.name, "@UI.TextArrangement": #TextOnly},
			ValueList: {entity: 'DimensionUnits', type: #fixed},
			ValueListWithFixedValues
		}
	);
	weightUnit: Association to fnd.Measures.Units.Weights @(
		title: '{i18n>weightUnit}',
		Common: {
			Text: {$value: weightUnit.name, "@UI.TextArrangement": #TextOnly},
			ValueList: {entity: 'WeightUnits', type: #fixed},
			ValueListWithFixedValues
		}
	);
	baseUnit: Association to fnd.Measures.Units.Bases not null @(
		title: '{i18n>baseUnit}',
		Common: {
			Text: {$value: baseUnit.name, "@UI.TextArrangement": #TextOnly},
			ValueList: {entity: 'BaseUnits', type: #fixed},
			FieldControl: #Mandatory
		}
	);

	// supply
	supplier: Association to Suppliers not null @(
		title: '{i18n>supplier}',
		Common: {
			Text: {$value: supplier.name, "@UI.TextArrangement": #TextOnly},
			ValueList: {entity: 'Suppliers', type: #fixed},
			FieldControl: #Mandatory
		}
	);
	stock: Association to Stocks not null @title: '{i18n>productStock}';
}

annotate Products with {
	ID @(
		odata.Type:'Edm.String',
		title: '{i18n>product}', 
		Common: {
			SemanticObject: 'EPMProduct',
			Text: name
		},
		Core.Immutable
	);
}

entity Suppliers: fnd.BusinessPartner {
}

annotate Suppliers with {
	ID @title: '{i18n>supplier}';
	name @title: '{i18n>supplierName}';
}

entity Categories: fnd.BusinessObject {
	name: localized String not null @(
		title: '{i18n>categoryName}',
		Common.FieldControl: #Mandatory,
		Search.defaultSearchElement
	);
	description: localized String @title: '{i18n>description}';
}

annotate Categories with {
	ID @title: '{i18n>category}';
}

entity Stocks: fnd.BusinessObject {
	quantity: Decimal(13, 3) not null @(
		title: '{i18n>quantity}',
		Common.FieldControl: #Mandatory
	);
	minimumQuantity: Decimal(13, 3) @title: '{i18n>minimumStock}';
	availability: Association to StockAvailabilities @(
		title: '{i18n>availability}',
		Common: {
			Text: {$value: availability.name, "@UI.TextArrangement": #TextOnly},
			ValueList: {entity: 'StockAvailabilities', type: #fixed},
			ValueListWithFixedValues
		},
		Common.FieldControl: #ReadOnly
	);
}

annotate Stocks with {
	ID @title: '{i18n>stock}';
}

entity StockAvailabilities: CodeList {
	key code: Integer @(
		title: '{i18n>availability}',
		description: '{i18n>availabilityIndicator}',
		Common.Text: {$value: name, "@UI.TextArrangement": #TextOnly}
	);
}

annotate StockAvailabilities with {
	name @title: '{i18n>availability}';
}

entity PriceRanges: CodeList {
	key code: Integer @(
		title: '{i18n>priceRange}',
		description: '{i18n>priceRangeIndicator}',
		Common.Text: {$value: name, "@UI.TextArrangement": #TextOnly}
	);
}

annotate PriceRanges with {
	name @title: '{i18n>priceRange}';
}

